import React, { Component } from 'react';
import { ScrollView, StyleSheet, Text, View } from 'react-native';




class Home extends Component {

    render() {
        return (
            <ScrollView>
                <View >
                    <Text>Hello World</Text>
                </View>


            </ScrollView>
        );
    }
}

export default Home;
